import React, { Component, useState, render } from 'react';
import classes from './TestUI.module.css';
import Carousel from 'react-bootstrap/Carousel';
import bgimage from '../../../assets/images/burger-logo.png';
import Logo from '../../Logo/Logo';

class TestUI extends Component {
    state = {
        index: 0
    };

    handleSelect = (event) => {
        console.log(event);
        this.setState({ index: event});
    };

    render() {
        return (
            <Carousel activeIndex={this.state.index} onSelect={event=>this.handleSelect(event)}>
                <Carousel.Item>
                    <Logo/>
                    <Carousel.Caption>
                        <h3>First slide label</h3>
                        <p>Nulla vitae elit libero, a pharetra augue mollis interdum.</p>
                    </Carousel.Caption>
                </Carousel.Item>
                <Carousel.Item>

                    <Carousel.Caption>
                        <h3>Second slide label</h3>
                        <p>Lorem ipsum dolor sit amet, consectetur adipiscing elit.</p>
                    </Carousel.Caption>
                </Carousel.Item>
                <Carousel.Item>
                    <Carousel.Caption>
                        <h3>Third slide label</h3>
                        <p>Praesent commodo cursus magna, vel scelerisque nisl consectetur.</p>
                    </Carousel.Caption>
                </Carousel.Item>
            </Carousel>
        );
    };

}




